import React from "react";
import PropTypes from "prop-types";

const Button = ({ id, value, event }) => {
  return (
    <button id={id} onClick={evenet}>
      {value}
    </button>
  );
};

Button.propTypes = {
  id: PropTypes.string.isRequired,
  value: PropTypes.string.isRequired,
};

export default Button;
